def get_fake_ua():
    location = './fake_useragent_0.1.11.json'
    ua = fake_useragent.UserAgent(path=location)

    headers = {
        'user-agent': ua.random
    }
    return headers

def get_week_day(date):
    week_day_dict = {
        0: '星期一',
        1: '星期二',
        2: '星期三',
        3: '星期四',
        4: '星期五',
        5: '星期六',
        6: '星期天',
    }
    day = date.weekday()
    return "今天日期为：" + "\n" + str(datetime.date.today()) + ' ' + week_day_dict[day]

def weather(address, key, day):  # day ：0 =今天 1 明天 2后天 （最大为2）
    url = f"https://free-api.heweather.com/s6/weather/forecast"
    content = {
        'day': '',  # 日期
        'city': '',  # 城市
        'province': '',  # 省份
        'cond_txt_d': '',  # 初始  初始 转 结束
        'cond_txt_n': '',  # 结束
        'cond_msg': '',  # 天气提示语
        'tmp_max': '',  # 最高温度
        'tmp_min': '',  # 最低温度
        'wind_dir': ''  #风向
    }
    try:
        if day > 2:
            return '超出天数'
        dic = {
            'location': f'{address}',
            'key': f'{key}',
            'lang': 'zh'
        }
        req = requests.get(url=url, params=dic)

        req_json = req.json()
        content['city'] = req_json['HeWeather6'][0]['basic']['location']  # 城市
        content['province'] = req_json['HeWeather6'][0]['basic']['admin_area']  # 省份

        content['day'] = req_json['HeWeather6'][0]['daily_forecast'][day]['date']  # 日期
        content['cond_txt_d'] = req_json['HeWeather6'][0]['daily_forecast'][day]['cond_txt_d']  # 天气
        content['cond_txt_n'] = req_json['HeWeather6'][0]['daily_forecast'][day]['cond_txt_n']  # 天气

        content['tmp_max'] = req_json['HeWeather6'][0]['daily_forecast'][day]['tmp_max']  # 最高温度
        content['tmp_min'] = req_json['HeWeather6'][0]['daily_forecast'][day]['tmp_min']  # 最低温度
        content['wind_dir'] = req_json['HeWeather6'][0]['daily_forecast'][day]['wind_dir'] # 风向

        return content

    except Exception as e:
        print(f"出错了  错误信息是{e}")

# 整合天气提示语
def get_weather(day): #今天，明天，后台的天气信息
    weather_result = weather(tqcity, tqkey, day=day) 
    if day == 0:
        weather_msg = f"{weather_result['province']} {weather_result['city']} \n今日预报: {weather_result['cond_txt_d']} 转 {weather_result['cond_txt_n']} {weather_result['wind_dir']}\n最高温度 {weather_result['tmp_max']}°C  最低温度 {weather_result['tmp_min']}°C "

    elif day == 1:
        weather_msg = f"{weather_result['province']} {weather_result['city']} \n明天天气预报: {weather_result['cond_txt_d']} 转 {weather_result['cond_txt_n']} {weather_result['wind_dir']}\n最高温度 {weather_result['tmp_max']}°C  最低温度 {weather_result['tmp_min']}°C "

    elif day == 2:
        weather_msg = f"{weather_result['province']} {weather_result['city']} \n下周一天气预报: {weather_result['cond_txt_d']} 转 {weather_result['cond_txt_n']} {weather_result['wind_dir']}\n最高温度 {weather_result['tmp_max']}°C  最低温度 {weather_result['tmp_min']}°C "

    return weather_msg

def get_top_list():
    requests_page = requests.get('http://top.baidu.com/buzz?b=1&c=513&fr=topbuzz_b42_c513')
    soup = BeautifulSoup(requests_page.text, "lxml")
    soup_text = soup.find_all("a", class_='title_dIF3B')
    i = 0
    top_list = []
    for text in soup_text:
        i += 1
        top_list.append("[" + text.text + "](" + text['href'] + ")")
        if i == 10:
            break
    return top_list

def get_daily_sentence():
    url = "http://open.iciba.com/dsapi/"
    r = requests.get(url)
    r = json.loads(r.text)
    content = r["content"]
    note = r["note"]
    daily_sentence = "> " + content + "\n" + "> " + note
    return daily_sentence

def greetings():
    hour = int(time.strftime('%H', time.localtime(time.time())))
    if hour == 7:
        return "各位同事早上好！记得打卡哦。\n"
    if hour == 12:
        return "人是铁饭是钢，及时用餐身体好哦。"
    if hour == 20:
        return "各位同事下班记得打卡哦！"
    else:
        return "测试信息"

def get_sendContent(day):
    sendContent = greetings() + "\n" + get_week_day(datetime.date.today()) + "\n" + get_weather(day) + "\n\n" + str(get_top_list()).replace("', '", '\n').replace("['", "").replace("']", "") + "\n\n" + get_daily_sentence()
    return sendContent

def send(content):

    url = VXurl
    headers = {"Content-Type": "text/plain"}
    data = {
        "msgtype": "markdown",
        "markdown": {
            "content": content,
        }
    }
    requests_url = requests.post(url, headers=headers, data=json.dumps(data))
    if requests_url.text == '{"errcode":0,"errmsg":"ok"}':
        return "发送成功"
    else:
        return "发送失败" + requests_url.text

def weather_send1(): 
    print(send(get_sendContent(0)))

def weather_send2(): 
    print(send(get_sendContent(1)))

def weather_send3(): 
    print(send(get_sendContent(2)))

